import styled from "styled-components"

const Input = styled.input`
        order: 1px solid #FEFBF6;
        background: transparent;
        border: 1px solid #FEFBF6;
        padding: 20px 140px;
        border-radius: 50px;
        width: 200px;
        color: #FEFBF6;
        font-size: 16px;
        margin-bottom: 10px;

        &::placeholder {
                color: #FEFBF6;
                font-size: 16px;
        }
`

export default Input
